import './App.scss';
import Main from './pages/main/main.page.jsx';
import Store from './pages/store/store.page';

function App() {
  return (


    <div className="App">
      <div className="container">
        <BrowserRouter>
          <Routes>
            <Route path="/" element={<Main />}/>
            <Route path="/store" element={<Store />}/>
            <Route path="/admin-page" element={<Admin />}/>
          </Routes>
        </BrowserRouter>
      </div>
    </div>

  );
}

export default App;
